import React from "react";
import { notStrictEqual } from "assert";

const Course = props => {
  const { course } = props;
  console.log(course);
  const rows = () =>
    course.parts.map(el => (
      <p key={el.id}>
        {el.name} {el.exercises}
      </p>
    ));

  return (
    <div>
      <h1>Half Stack application development</h1>
      <ul>{rows()}</ul>
    </div>
  );
};
